import React from "react";
import ReactDOM from "react-dom";







function Footer(){
    const footer = {
        position: "absolute",
        textAlign: "center",
        bottom: "0",
        width: "100%",
        height: "2.5rem"
      }
      
     const footerpp ={
        color: "ccc",
      }
    



  const date = new Date()
  const currentDate = date.getFullYear()
  return <p style = {footer,footerp}>Copyright{currentDate}</p>
}

export default Footer;
